import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Home from './pages/home';

function App() {
  return (
    <BrowserRouter>
    <link href="/dist/output.css" rel="stylesheet"></link>
    <Routes>
    <Route path="/" element={<Home />}> </Route>

    </Routes>

  </BrowserRouter>
  );
}

export default App;
